import React from 'react';
import './Rolled.css'
import { Container, Row, Col } from 'react-bootstrap';

const Rolled = ({num, text}) => {
  return (
    <Container>
      <Row className="justify-content-center">
        <Col xs={8} lg={6} className="mt-4 rounded rollCard">
            <Row className="py-3">
            <Col xs={4}>{num}</Col>
            <Col xs={8}>{text}</Col>
            </Row>
        </Col>
      </Row>
    </Container>
  );
}

export default Rolled;
